import Nav from "./components/Nav";

class Search extends Component {

    state = {
        friends,
        topscore: 0,
        currentscore: 0,
        chosenPokemon: []
      };


  render() {
    return (
      <Container fluid>
        <Row>
          <Col size="md-6">
            <h1>"Hello World</h1>
          </Col>
        </Row>
      </Container>
    );
  }
}

export default Search;
